  // See https://github.com/siimon/prom-client#configuration\n        config: {},\n      },\n    }),\n  ],\n})\nexport class AppModule {}Injecting individual metrics\n// module.ts\nimport { Module } from \"@nestjs/common\";\nimport {\n  PrometheusModule,\n  makeCounterProvider,\n} from \"@willsoto/nestjs-prometheus\";\nimport { Service } from \"./service\";\n\n@Module({\n  imports: [PrometheusModule.register()],\n  providers: [\n    Service,\n    makeCounterProvider({\n      name: \"metric_name\",\n      help: \"metric_help\",\n    }),\n  ],\n})\nexport class AppModule {}// service.ts\nimport { Injectable } from \"@nestjs/common\";\nimport { Counter } from \"prom-client\";\n\n@Injectable()\nexport class Service {\n  constructor(@InjectMetric(\"metric_name\") public counter: Counter) {}\n}Available metrics\nCounter\nimport { makeCounterProvider } from \"@willsoto/nestjs-prometheus\";Gauge\nimport { makeGaugeProvider } from \"@willsoto/nestjs-prometheus\";Histogram\nimport { makeHistogramProvider } from \"@willsoto/nestjs-prometheus\";Summary\nimport { makeSummaryProvider } from \"@willsoto/nestjs-prometheus\";\n\n\n\n\n\n\n\n\n\n\n\n\n\n                   \n\n\n\n\n                   \n    \n         result-matching \"\"\n        \n    \n    \n        No results matching \"\"\n    \n\n"},"modules.html":{"url":"modules.html","title":"modules - modules","body":"\n                   \n\n\n\n\n    Modules\n\n\n    \n            \n                \n                    \n                        PrometheusModule\n                    \n                    \n                                \n                                    No graph available.\n                                \n                        \n                            Browse\n                        \n                    \n                \n            \n    \n\n\n\n\n\n\n\n\n\n\n\n\n                   \n\n\n\n\n                   \n    \n         result-matching \"\"\n        \n    \n    \n        No results 